import { Typography, AppBar, Link, Menu, Grid, Toolbar, Container, Tabs, Tab, Box, IconButton, Button } from '@material-ui/core'

import useStyles from "../styles";

const UserProfile = (children) => {

    return (
        <Box sx={{ width: '100%', bgcolor: 'background.paper' }}>
        <Card className={classes.card}>
            <CardMedia 
                className = {classes.cardMedia}
                image={require('../data/participant_profiles/'+String(children)+'.jpg')} 
                title="Image title"
            />
            <CardContent className={classes.cardContent}>
                <Typography variant="h5">
                    {children}
                </Typography>
                <Typography>
                    This image shows the user profile of {String(children).toLowerCase()}
                </Typography>
            </CardContent>
        </Card>
        </Box>
    );
}
export default UserProfile;
